import React, { Component } from 'react';
import './css/extra.css';


class Extra extends Component {
    constructor() {
        super();

        this.state = {
            desc: 'Music',
        }
    }

    render() {
        const { desc } = this.state;

        return (
            <div id="extra">
                <div id="headingwrap">
                    <div id="heading">INTERESTS</div>
                    <button id="addExtra">+</button>
                </div>

                <div className="flexwrap">
                    <div className="wrapperEdu">
                        <div className="desc" contentEditable="true">{desc}</div>
                    </div>
                </div>

            </div>
        )
    }
}

export default Extra
